import { render } from "react-dom";
import {Button} from "react-bootstrap"

function TablaBody(data){

return data.data.map((item,index)=>{
    return(
  <ul> <li key={index}>
      
          <div> 
         <h2>{item.nombre}</h2>
         <h3>{item.precio}</h3>
         <Button onClick={(event)=> data.handleComida(event, item)}> Eliminar </Button>
         </div>
      
  </li>
  
  </ul>
  
    );
})
    }
   
   function TablaCarrito(props){
        return TablaBody(props)
    }

    export default TablaCarrito;
